import React from 'react';
import {BrowserRouter, Route} from 'react-router-dom';
import './App.css';
import Body from './Body';
import Header from './Header';
import TileTunes from './TileTunes';
import DiscoBot from './DiscoBot';
import PVDCM from './PVDCM';
import WiCSHistory from './WiCSHistory';

const current_page = [
  { name: "about", index: 0 },
  { name: "portfolio", index: 1},
  { name: "tiletunes", index: 2},
  { name: "discobot", index: 3},
  { name: "pvdcm", index: 4},
  { name: "wicshistory", index: 5}
];

function App() {
  return (
    <BrowserRouter>
      <div>
        <Route exact={true} path='/' render={() => (
          <div className="App">
            <Body page={current_page}/>
          </div>
        )}/>
        <Route exact={true} path='/work' render={() => (
          <div className="App">
            <Body page={current_page}/>
          </div>
        )}/>
        <Route exact={true} path='/tiletunes' render={() => (
          <div className="App">
            <Header />
            <TileTunes />
          </div>
        )}/>
        <Route exact={true} path='/discobot' render={() => (
          <div className="App">
            <Header />
            <DiscoBot />
          </div>
        )}/>
        <Route exact={true} path='/pvdcm' render={() => (
          <div className="App">
            <Header />
            <PVDCM />
          </div>
        )}/>
        <Route exact={true} path='/wicshistory' render={() => (
          <div className="App">
            <Header />
            <WiCSHistory />
          </div>
        )}/>
      </div>
    </BrowserRouter>
  );
}
export default App;
